import React from 'react';

const MessageInfo: React.FC = () => {
  return (
    <div className="flex flex-col ml-56">
      <div className="bg-white p-4 border-2 h-20 rounded mb-6">
        <div>
          <div className='text-xs' style={{ color: "#02963A" }}>Unread</div>
        </div>
      </div>
      <div className='flex flex-row ml-56'>
        <div>
        <img
          className="w-6 h-6"
          src='/assets/shiek.svg'
          alt="Profile"
        />
        </div>
      </div>
      <div className="bg-white p-4 border-2 h-20 rounded mb-6">2</div>
      <div className="bg-white p-4 border-2 h-20 rounded mb-6">3</div>
      <div className="bg-white p-4 border-2 h-20 rounded mb-6">4</div>
    </div>
  );
};

export default MessageInfo;
